import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronRight } from '@fortawesome/free-solid-svg-icons';
import 'components/SetlistResult/SetlistResult.css';

const setlistResult = (props) => {
        return(
            <Row className="mb-4">
                <Col md={{ span: 6, offset: 3}} className="setlistResult">
                    <Row>
                        <Col md={{ span: 2 }}>
                        <div className="dateBlock">
                            <span className="month">Jan</span>
                            <span className="day">1</span>
                            <span className="year">2020</span>
                        </div>
                    </Col>

                    <Col md={{ span: 9 }}>
                        <span className="artistName">{this.props.artistName}</span>
                    <div className="venue">The Drake Hotel, Toronto, ON, Canada</div>
                    <div className="numSongs">10 songs</div>
                    </Col>
                    <Col md={{ span: 1 }} className="d-flex align-items-center">
                    <FontAwesomeIcon icon={faChevronRight} size ="2x" />
                    </Col>
                    </Row>

                </Col>
            </Row>
        )
}

export default setlistResult;
